function getStyles(){
    let s = '';
    s += "#branding {background-image: url('data:image/png;base64,')}";
    s += 'li.menu-main-search .searchform input[type="search"] {border-color: #660066; background-color: #cc66ff;} ';
    s += 'a {color: #660099;} ';
    s += '.entry-title a:hover {color: #660099; }';
    s += '#site-description {color: #660099; }';
    s += 'a.continue-reading-link, #cryout_ajax_more_trigger {background-color: #660099; }';
    s += '#access, #nav-toggle {background-color: #990099;} ';
    s += '#access ul li.current_page_item > a, #access ul li.current-menu-item > a, #access ul li.current_page_ancestor > a, #access ul li.current-menu-ancestor > a {background-color: #cc0066;} ';
    s += '#access ul ul li a {color: #660099;} ';
    s += '#access ul ul li a:hover {background-color: #cc99cc;} ';
    s += '#access a:hover {background-color: #660099;} ';
    s += '#access > .menu > ul > li > a > span {border-color: #660066; box-shadow: 1px 0 0 #7718bd;} ';
    s += '.tribe-events-notices {color: #993399; background-color: #ffccff; border-color:#ff99ff;} ';
    s += '#cff .cff-item {border-bottom: 1px solid #660099 !important;} ';
    s += '.sidey .widget-title {background-color: #990099; border-color:#660099;}';
    s += '.socials .socials-hover {background-color: #bb77cc;}';
    s += '.socials a {background-color: #660099;}';
    s += '#catapult-cookie-bar {position: absolut;}';
    return s;
}

function expandMenu() {
    let exists = document.getElementById('menu-item-7331');
    if (exists) return;
    let menu = document.getElementById('prime_nav');
    let menu_li = document.createElement('li');
        menu_li.setAttribute('class', "li menu-item menu-item-type-custom menu-item-object-custom menu-item-1867");
        menu_li.setAttribute('id', "menu-item-7331");
    let menu_li_a = document.createElement('a');
        menu_li_a.setAttribute('aria-haspopup', "true");
    let menu_li_a_span = document.createElement('span');
        menu_li_a_span.setAttribute('style', "padding-top: 3px; padding-bottom: 2px;");
    let menu_li_a_span_img = document.createElement('img');
        menu_li_a_span_img.setAttribute('src', "#");
        menu_li_a_span_img.setAttribute('alt', "Extras");
    (async function() {
        menu_li_a_span_img.src = await GM.getResourceUrl("icon");
    })();
    menu_li_a_span.appendChild(menu_li_a_span_img);
    menu_li_a.appendChild(menu_li_a_span);
    menu_li.appendChild(menu_li_a);

    let menu_li_ul = document.createElement('ul');
        menu_li_ul.setAttribute('class', "sub-menu");
    let menu_li_ul_li, menu_li_ul_li_a, menu_li_ul_li_a_span;
    let pages = [["/deotto", "Deottorisierer"], ["/istheutestupa", "Ist Heute Stupa?"]];
    for (let i=0; i<pages.length; i++){
        menu_li_ul_li = document.createElement('li');
        menu_li_ul_li.setAttribute('id', "menu-item-"+(7332+i));
        menu_li_ul_li.setAttribute('class', "menu-item menu-item-type-custom menu-item-object-custom menu-item-"+(7332+i));
        menu_li_ul_li_a = document.createElement('a');
        menu_li_ul_li_a.setAttribute('href', pages[i][0]);
        menu_li_ul_li_a_span = document.createElement('span');
        menu_li_ul_li_a_span.appendChild(document.createTextNode(pages[i][1]));
        menu_li_ul_li_a.appendChild(menu_li_ul_li_a_span);
        menu_li_ul_li.appendChild(menu_li_ul_li_a);
        menu_li_ul.appendChild(menu_li_ul_li);
    }
    menu_li.appendChild(menu_li_ul);
    menu.insertBefore(menu_li, menu.lastChild);
}

function deotto(){
    let head = document.head || document.getElementsByTagName('head')[0];
    if (head) {
        let text = "";
        text += getStyles();
        let s = document.createElement('style');
        s.appendChild(document.createTextNode(text));
        head.appendChild(s);
        for(let i = 0; i < head.getElementsByTagName('link').length; i++){
            let e = head.getElementsByTagName('link')[i];
            if (e.getAttribute('rel') === "icon" && e.getAttribute('sizes') === "32x32"){
                (async function() {
                    e.href = await GM.getResourceUrl("icon");
                })();
                break;
            }
        }
    }
    let body = document.body || document.getElementsByTagName('body')[0];
    if(body)
        expandMenu();
}

deotto();

function hiddenPages(){
    let url = window.location.href;
    let n = url.indexOf(".de/");
    if(n != -1)
        build(url.substr(n+4));
}

function build(page){
    switch (page){
        case "deotto":
            document.getElementsByTagName('title')[0].firstChild.nodeValue = 'Deottorisierer';
            document.getElementById('post-0').innerHTML ='<h1><img src=\"#\" alt=\"logo\" /> Deottorisierer</h1><p>Informationen zum user script findest du auf <a href=\"https://user.informatik.uni-goettingen.de/~felix.schelle1/hopotenuse/deotto\">https://user.informatik.uni-goettingen.de/~felix.schelle1/hopotenuse/deotto</a></p><p>Installierte Version: '+GM.info.script.version+'</p>';
            (async function() {
                let img = document.getElementById('post-0').getElementsByTagName('img')[0];
                img.src = await GM.getResourceUrl("icon");
            })();
            break;
        case "istheutestupa":
            document.getElementsByTagName('title')[0].firstChild.nodeValue = 'Ist Heute Stupa?';
            document.getElementById('post-0').innerHTML ='<h1><img src=\"data:image/png;base64,\" alt=\"SRK\" style="height:32px;background-color:#ff6666;" /> Ist Heute Stupa?</h1>' + '<a href=\"https://istheutestupa.de/\">https://istheutestupa.de/</a>';
            break;
        case "devotto":
            (async function() {
                let img = document.createElement('img');
                img.src = await GM.getResourceUrl("icon");
                document.getElementsByTagName('title')[0].firstChild.nodeValue = 'devotto';
                document.getElementById('post-0').innerHTML = '<h1>dev Testbereich</h1>';
                document.getElementById('post-0').appendChild(img);
            })();
            break;
    }
}

hiddenPages();
